We have scraped the fields that are coming out of the Alma publishing job in https://github.com/pulibrary/marc_liberation/issues/714
The google spreadsheet: https://github.com/pulibrary/marc_liberation/issues/749#issuecomment-673648035. To force a bib reindex we need first to decide on the fields that will need to be reindexed so that we know what API calls need to happen. These will be part of the new method in the alma adapter when passing an `mms_id` in the `find_by_id` method.
@mzelesky will have more info on these fields.
